import React from 'react';
import logo from './logo.svg';
import './App.css';
import Form from './components/FormContainer.js';
import Boulder from './components/Boulder.js';

function App() {
  return (
    <div className="App">
      <Form />
      <Boulder />
    </div>
  );
}

export default App;
